import React from "react";

const Pagination = (itemsCount, pageSize) => {
    const pagesCount = itemsCount / pageSize;
    
  return (
    <nav aria-label="Page navigation example">
      <ul class="pagination">
        <li class="page-item">
          <a class="page-link" href="#">
            1
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Pagination;
